import React from 'react';
import './App.css';
import axios from "axios";

function App() {

  const useAPI = async () => {

    return await axios.get( process.env.REACT_APP_API_URL )
        .then( ( res ) => {
          return res.data;
        } );
  }

  return (
    <div className="App">
      {/*<Router>*/}
      {/*  */}
      {/*</Router>*/}
        {process.env.REACT_APP_API_URL}
      {useAPI()}
    </div>
  );
}

export default App;
